import { Link } from 'react-router-dom';

class Work extends React.Component {
    render() {
        return (
            <div>
                <h1></h1>
                <nav>
                <Link to="/about">WORK</Link> 
                <Link to="/about">ABOUT</Link> 
                <Link to="/about">CONTACT</Link> 
                </nav>
            </div>
        )
    }
}

export default Work;
